            "eventDate": "2020-01-09",
            "eventTime": "095000",
            "eventTopic": "Hydrosfera\n1. Elementy obiegu wody w przyrodzie.\n2. Wskazanie i wytłumaczenie przyczyn istnienia obszarów o ujemnym lub dodatnim bilansie.\n3. Rodzaje mórz oraz przykłady.\n4. Przyczyny różnic w zasoleniu wód oceanicznych.\n5. Pływy - przyczyny, skutki, obszary o największej amplitudzie.\n6. Prądy morskie - przyczyny i  skutki, rozmieszczenie na mapie, nazwy prądów ciepłych i zimnych.\n7. Upwelling - mechanizm powstawania, obszary występowania i znaczenie.\n8. Podział rzek wg różnych kryteriów.\n9. Typy ustrojów rzecznych - rozpoznawanie wykresów, przykłady rzek, wytłumaczenie wezbrań i niżówek.\n10. Znaczenie rzek, skutki powodzi.\n11. Podział jezior wg. różnych kryteriów. Typy jezior wg genezy misy jeziornej z przykładami.\n12. Etapy powstawania torfowiska. Rodzaje torfowisk.\n13. Powstawanie lodowców, przebieg granicy wiecznego śniegu, fazy przemiany śniegu w lód lodowcowy.\n14. Typy lodowców górskich - rozpoznawanie na rysunku i na podstawie opisu, występowanie.\n15. Rodzaje wód podziemnych i ich znaczenie/ wykorzystanie.\n16. Wody artezyjskie - warunki powstawania.\n17. Rodzaje źródeł i mechanizm działania gejzerów.\n18. Terminy geograficzne dotyczące poszczególnych zagadnień.",
