            "eventTopic": "Wnętrze Ziemi. Procesy endogeniczne.\n1. Budowa wnętrza Ziemi - warstwy, ich skład, strefy nieciągłości, obliczanie stopnia geotermicznego\n2. Budowa skorupy ziemskiej\n3. Teoria tektoniki płyt litosfery, przebieg granic płyt litosfery\n4. Teorie powstawania gór fałdowych. Orogenezy - czas występowania i pasma górskie.\n5. Deformacje tektoniczne\n6. Dzieje Ziemi - najważniejsze wydarzenia. Znajomość tabeli stratygraficznej.\n7. Metody badań wieku skał. Skamieniałości przewodnie\n8. Analiza przekrojów geologicznych",
