            "announcementSubject": "Dyżur w Poradni Psychologiczno-Pedagogicznej nr 4",
            "announcementText": "Drodzy Uczniowie/Szanowni Państwo,\r\n\r\nprzekazuję informację o dyżurach specjalistów w Poradni Psychologiczno-Pedagogicznej nr 4, która współpracuje z naszą szkołą.\r\n\r\nDyżur pedagoga:\r\npedagog@ppp4.edu.pl\r\nponiedziałek -piątek godz. 8-12 tel. 516 779 357\r\n\r\nDyżur psychologa\r\npsycholog@ppp4.edu.pl\r\nponiedziałek-piątek godz. 12-19 tel. 516 779 357\r\n\r\nDyżur sekretariatu poradni\r\nppp4@edu.um.warszawa.pl\r\nponiedziałek-piątek godz. 8-16 tel. 22 810 20 29",
