            "profileId": 1,
            "announcementId": 3568922992,
            "announcementSubject": "Coaching edukacyjny dla uczniów",
            "announcementText": "Drodzy Uczniowie,\r\n\r\nStowarzyszenie Q Zmianom, które już drugi rok współpracuje z naszą szkołą, uruchamia nową inicjatywę - coaching edukacyjny.\r\nBędą to spotkania online w małych grupach raz w tygodniu. Mają służyć przezwyciężaniu trudności związanych z nauką zdalną. Oferta jest kierowana również dla maturzystów!\r\n\r\nZapisy w formularzu pod linkiem\r\nhttps://docs.google.com/forms/d/e/1FAIpQLSceqFX2gXjMFito16GmCznfizs8bX7NcpRGQVwSwkIiuE6-bA/viewform?fbclid=IwAR39DwjUP3PFZtVZ0ehPfFcVpIB1VAzBbuhHp12M9Lv_wL0SIptU4GzY6C4",
