            "messageSubject": "oceny proponowane",
            "messageBody": "Drodzy Uczniowie, \n<br> \n<br> wystawiłam oceny proponowane na koniec roku. Ocena z plusem tradycyjnie oznacza, że jest szansa zmienić obecną sytuację i oczywiście zależy ona od tego jak dobrze zostanie napisany przyszły sprawdzian.\n<br> \n<br> Przypominam, że pozytywna ocena końcoworoczna jest wystawiana pod warunkiem uzyskania minimum oceny dopuszczającej z każdego semestru.\n<br> \n<br> Pozdrawiam, \n<br> Joanna Bujak\n<br> \n<br> \n<br> -----\n<br> Kopia powyższej wiadomości została wysłana do nauczyciela: Kowalczyk Elżbieta",
